import React from 'react';
import {Routes,Route} from 'react-router-dom';
import { useDispatch } from 'react-redux';
import Home from './components/routes/home/Home';
import Navigation from './components/routes/navigation/Navigation';
import Authentication from './components/routes/authentication/Authentication.jsx';
import { createUserDocumentFromAuth } from './components/util/firebase/Firebase';
import { useEffect } from "react";
import { onAuthStateChnagedListener } from '../src/components/util/firebase/Firebase.jsx';
import {setCurrentUser} from '../src/components/store/user/UserAction';

function App(props) {
  const dispatch = useDispatch();
  useEffect(()=>{
    const unsubscribe =  onAuthStateChnagedListener((user)=>{
      console.log("Correct")
      if(user){
        createUserDocumentFromAuth(user);
      }
      dispatch(setCurrentUser(user));
    })
    return unsubscribe
      });
  return (
    <Routes>
      <Route path='/' element={<Navigation/>}>
      <Route index element={<Home/>}/>
      <Route path='home' element={<Home/>}/>
      <Route path='signIn' element={<Authentication/>}/>
      </Route>
    </Routes>
  );
}

export default App;
